The Olympic champion is the 2021 #DiamondLeague winner – and what a thriller competition it was! 💎

@lasitskene.maria wins the women's high jump in a world-leading 2.05m – and a @weltklassezurich meeting record.

@rosya_dp clears 2.03m and @nicolalmcdermott goes over 2.01m to make it the first ever Diamond League competition in which three women went 2.01m or higher.

📸 @matthewquine / @diamondleagueathletics 

#WDLFinal #zurichdl #athletics #trackandfield #highjump

Diamond League legends check ✅ 

@airlavillenie, @taylored2jump, @valerieadams84, @triplecibarguen and @discus70queen are Diamond League GOATS. Who’s excited for the finals in Zurich this week? 

#DiamondLeague #Athletics #Track #TrackAndField
